Not getting output while trying db.find() in Mongodb<p>Recently i have started learning mongodb and started to make a simple application that will just display the data present in my database.
Here's the code:</p>
<pre><code>var mongoose = require(&quot;mongoose&quot;);
mongoose.connect(&quot;mongodb://localhost/new_app&quot;,{ useNewUrlParser: true });

var familySchema = new mongoose.Schema({
    name:String,
    age:Number,
    gender:String   
});

var family = mongoose.model(&quot;family&quot;, familySchema);
family.create({
    name: &quot;Test&quot;, age: 17, gender: &quot;Male&quot;
},function(err,member){
    if(member){
        console.log(&quot;Added Successfully&quot;);
    }
});

family.find({}, function(err,members){
    if(members){
        console.log(members);
    }       
});
</code></pre>
<p>After running this code, the data successfully gets stored in the database but it didn't show me the output of all the data in my database.
Can anyone explain how to fix this issue? Thanks in advance</p>

