<p>I currently have an <strong>index.js</strong> script for the API using the 'express' module. For a GET request I want to return the query results in an array/json as a response. I am importing the mongoDB query from another script I made called <strong>db_functions.js</strong>.</p>
<p><strong>I have tried messing with the functions, trying to add return statements or something just to be get the query function I wrote to return an array. I have probably spent too much time on this issue already and its probably something simple that I didn't do.</strong></p>
<p>I have a GET request looking like the following:</p>
<pre><code>app.get('/db_query', function (req, res) {

    var result = db_functions.return_query();
    res.send(result)
});
</code></pre>
<p>I have experimented with some code I found at <strong>w3schools</strong>  here: <a href="https://www.w3schools.com/nodejs/nodejs_mongodb_query.asp" rel="nofollow noreferrer">https://www.w3schools.com/nodejs/nodejs_mongodb_query.asp</a></p>
<p>It displays the result in the console but I want to return the result in an array to the client response.</p>
<pre><code>const  db_url = &quot;mongodb://localhost:27017/&quot;;
const  client = MongoClient(db_url, { useNewUrlParser:  true, useUnifiedTopology:  true })


function  return_query() {
