        db_var.collection(&quot;simple_data&quot;).find({}).toArray(function(err, result) {
            if (err) throw  err;
            console.log(result);
            db.close()
        });
    });
};

</code></pre>
<p>I want the client response to look like the one in the console.log shown below:</p>
