<p>This returns me a &quot;Discord.Collection&quot; object which is essentially a Map object.</p>
<p>Then I connect to my MongoDB using mongoose and I create a new document for each member of my members collection using :</p>
<pre><code>await mongo().then(async mongoose =&gt; {
        try {
            members.each(async member =&gt; {
                const {user} = member
                await discordUserSchema.findOneAndUpdate({
                    _id: user.id
                }, {
                    _id: user.id,
                    username: user.username,
                    discriminator: user.discriminator,
                    avatar: user.avatar,
                    bot: user.bot
                }, {
                    upsert: true
                });
            });
        } finally {
            mongoose.connection.close();
        }
